/**
 * @hidden
 */
export function boolToString(value) {
    return String(value);
}
/**
 * @hidden
 */
export function boolFromUnknown(value) {
    if (value === 'false') {
        return false;
    }
    return !!value;
}
/**
 * @hidden
 */
export function BooleanFormatter(value) {
    return boolToString(value);
}
